import HomePage from './homePage';
import Contact from "./Contact";
import { BrowserRouter, Route, Switch } from 'react-router-dom'

import './App.css';
import './homePage.css';

function App() {
  return (
    <div className="App">
      <HomePage />
      <Route path='/contact' component={Contact}/>
    </div>
  );
}

export default App
